INSERT INTO public."Producto" VALUES ('cmfew2nut000ns0jp7yvt82ni', '⚡ Fundamentos de Circuitos Eléctricos - Alexander & Sadiku 🔌', '🔧 Sexta edición del libro más completo para ingeniería eléctrica de McGraw Hill. ⚡ Cubre desde conceptos básicos hasta análisis avanzado de circuitos con transformadas de Laplace y Fourier. 📊 Incluye amplificadores operacionales, filtros, circuitos trifásicos y análisis de potencia. 🎯 Con aplicaciones prácticas usando PSpice y MATLAB. 💡 Ideal para estudiantes de ingeniería eléctrica, electrónica y afines. 🏗️ Revisión técnica de universidades mexicanas reconocidas. ⚙️', 83500.00, NULL, 'libros-usados', 'https://0dwas2ied3dcs14f.public.blob.vercel-storage.com/Accesorios/books/used/circuitos%20electricos/1.jpg', NULL, true, true, 1, 'LIBR-FUND-005', 'McGraw Hill', 'nuevo', '{}', '2025-08-01 10:00:00', '2025-09-11 04:09:03.557', 'neuraidev-principal');
INSERT INTO public."Producto" VALUES ('cmfew2nun000ls0jpcb1xizmd', '📐 Álgebra Intermedia - Allen R. Angel 🧮', '📚 Sexta edición de este reconocido libro de álgebra intermedia de la editorial Pearson. ✨ Enfoque pedagógico que hace que los estudiantes disfruten al leer y aprender. 🎯 Incluye aplicaciones del mundo real en cada capítulo y sección ''Matemáticas en acción''. 🔢 Cubre desde conceptos básicos hasta funciones exponenciales, logarítmicas y secciones cónicas. 💡 Con procedimiento de 5 pasos de George Polya para resolución de problemas y estrategias de estudio para el éxito. 📊', 33900.00, NULL, 'libros-usados', 'https://0dwas2ied3dcs14f.public.blob.vercel-storage.com/Accesorios/books/used/algebra_intermedia/1.jpg', NULL, false, true, 1, 'LIBR-LG-004', 'Pearson', 'nuevo', '{}', '2025-08-01 10:00:00', '2025-09-11 04:09:00', 'neuraidev-principal');
INSERT INTO public."Producto" VALUES ('cmfew2nvh000ts0jpxy5p4ght', '⚡ Circuitos Eléctricos - Dorf & Svoboda 🔌', '🎓 Libro universitario completo de análisis y diseño de circuitos eléctricos. ✨ Sexta edición corregida, revisada y actualizada por Alfaomega. 📐 Cubre desde variables del circuito hasta transformadas de Fourier y Laplace. 🔧 Incluye amplificadores operacionales, respuesta en frecuencia, filtros y redes de puertos múltiples. 🚫 No incluye CD. 📊 Enfoque práctico para ingeniería, comunicaciones, electrónica y sistemas de control. 🌟 Ideal para estudiantes de ingeniería eléctrica y electrónica. 🔍 Metodología paso a paso con soluciones detalladas y uso de MATLAB y PSpice. 🚀', 104900.00, NULL, 'libros-usados', 'https://0dwas2ied3dcs14f.public.blob.vercel-storage.com/Accesorios/books/used/circuitos%20dorf%20-%20svoboda/1.jpg', NULL, true, true, 1, 'LIBR-CIRC-008', 'Alfaomega', 'nuevo', '{}', '2025-08-01 10:00:00', '2025-09-11 04:09:03.581', 'neuraidev-principal');
INSERT INTO public."Producto" VALUES ('cmfew2nu6000js0jpsz2pef12', '📐 Precálculo - J. Douglas Faires & James DeFranza 📊', '🧮 Libro completo de precálculo que prepara solidamente para el cálculo universitario. ✨ Enfoque pedagógico que promueve aprendizaje activo en el estudiante. 📈 Cubre funciones lineales, cuadráticas, trigonométricas, exponenciales y logarítmicas. 🎯 Incluye secciones cónicas, coordenadas polares y ecuaciones paramétricas. 📚 Con ejemplos prácticos y aplicaciones reales que facilitan la comprensión de álgebra y trigonometría. 🔢 Segunda edición mejorada. 💡', 40900.00, NULL, 'libros-usados', 'https://0dwas2ied3dcs14f.public.blob.vercel-storage.com/Accesorios/books/used/precalculo/1.jpg', NULL, false, true, 1, 'LIBR-PRE-003', 'Pearson', 'nuevo', '{}', '2025-08-01 10:00:00', '2025-09-11 04:13:26.807', 'neuraidev-principal');
INSERT INTO public."Producto" VALUES ('cmfew2nvm000vs0jppu9ld4bs', '☕ Java Cómo Programar - Deitel 7ª Edición 💻', '📚 Libro clásico de programación Java de Harvey & Paul Deitel, séptima edición. 🎯 Método reconocido de ''código activo'' con ejemplos funcionales completos. ⚡ Cubre desde fundamentos hasta temas avanzados: POO, GUI, redes, bases de datos JDBC, servicios web y aplicaciones Ajax. 🖥️ Más de 20 capítulos con programación orientada a objetos, herencia, polimorfismo, excepciones, multithreading y multimedia. 🌐 Incluye desarrollo de aplicaciones web, componentes Swing, Java 2D y tecnologías Web 2.0. 📊 Con ejercicios de autoevaluación, ejemplos de código vivo y proyecto integrado. 🔧 Perfecto para estudiantes de ingeniería de sistemas, ciencias de la computación e informática. 📖 Versión impresa en blanco y negro, aproximadamente 1380 páginas. 🚀 Referencia indispensable para aprender Java desde cero hasta nivel avanzado. 💡', 44900.00, NULL, 'libros-usados', 'https://0dwas2ied3dcs14f.public.blob.vercel-storage.com/Accesorios/books/used/java%20deitel%208va/1.jpg', NULL, false, true, 1, 'LIBR-JAVA-009', 'Pearson', 'nuevo', '{}', '2025-08-01 10:00:00', '2025-09-11 04:09:00', 'neuraidev-principal');
